    <script>
        function myFunction(PLOT_NO) {
            getPlotData(PLOT_NO)
        }

        const getPlotData = (PLOT_NO) => {
            axios.get(`https://pragathi-project.herokuapp.com/api/plot/get_plot_byno/${PLOT_NO}`)
                .then(response => {
                    var plotData = response.data.data;
                    $("#divText").empty();
                   $("#divText").html('<div style="line-height:26px; text-align: left; color: #333; font-size: 14px; "> <span style="width: 100px; display: inline-block;">Plot No:</span>  <b> ' + plotData.PLOT_NO + '</b> <br> <span style="width: 100px; display: inline-block;">Plot Type </span>  <b> ' + plotData.PLOT_TYPE + ' </b> <br> <span style="width: 100px; display: inline-block;"> Area </span>  <b> ' + plotData.PLOT_AREA + ' </b> <br> <span style="width: 100px; display: inline-block;">Facing </span> <b> ' + plotData.PLOT_FACING + ' </b> <br> <span style="width: 100px; display: inline-block;">Status </span>  <b> ' + plotData.PLOT_STATUS + ' </b> <br><br>  For Booking Enquiry  <a href="enquiry.html?vid=1&pid=' + plotData.PLOT_ID + '" style="background-color: #199319; color: white; font-weight: bold; border-radius: 15px; padding: 3px 25px; text-decoration: none;"> Click Here </a> </div>').fadeIn(50000);
                $('#tabData').fous();
                })
                .catch(error => console.error(error));
        };
    </script>
